function ProfileTypeListDataSource(){var t=new kendo.data.DataSource({transport:{read:{url:"/api/profile_types",dataType:"json"}},schema:{total:"total",data:"data",model:{id:"id",fields:{id:{type:"string",editable:!1},username:{type:"string",editable:!0},email_id:{type:"string",editable:!0},role:{type:"string",editable:!0}}}},batch:!0,pageSize:100,serverPaging:!1,serverFiltering:!1,serverSorting:!1});return t}function ProfileTypeListGrid(){jQuery("#profile_type_List").kendoGrid({dataSource:ProfileTypeListDataSource(),resizable:!0,pageable:{refresh:!0},scrollable:!1,sortable:!0,columns:[{field:"name",title:"Name"},{command:[{name:"edit",text:"Edit",click:edit_systems},{name:"Delete",text:"Delete",click:delete_systems}]}]})}function edit_systems(t){var e=this.dataItem(jQuery(t.currentTarget).closest("tr"));openModal("profile_types/"+e.id+"/edit","#profiletypeModal")}function delete_systems(t){var e=this.dataItem(jQuery(t.currentTarget).closest("tr"));doDelete("/api/profile_types/"+e.id,e.id,"#profile_type_List")}$(document).ready(function(){ProfileTypeListGrid()});